import React from 'react';
import logo from './logo.svg';
import globalHook from 'use-global-hook';
import actions from './actions.js'
import MomentCard from './MomentCard.js'
import MomentPictureCard from './MomentPictureCard.js'
import CreateMoment from './CreateMoment.js';
import './App.css';

const initialState = {
  moments: {}
};

console.log("Begin")
console.log(initialState)
console.log(initialState.moments)
console.log("Done")

const useGlobal = globalHook(React, initialState, actions);

function App() {
    const [globalState, globalActions] = useGlobal();
    const moments_object = globalState.moments

  return (
    <div className="App">
      <header className="App-header">
        {Object.keys(moments_object).map((moment) => {
            return (
                <div>
                    <MomentPictureCard key={moments_object[moment].message}
                    globalActions={globalActions}
                    moment={moments_object[moment]}/>

                    <MomentCard key={moments_object[moment].message}
                    globalActions={globalActions}
                    moment={moments_object[moment]}/>
                </ div>
            )

        })}

        <CreateMoment globalState={globalState} globalActions={globalActions}/>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
